import styled from 'styled-components';

const BurgerDiv = styled.div
`
    width: 100%;
    margin: auto;
    flex-direction: column;
    flex: 1;
    cursor: pointer;
    @media (min-width: 292px) {
        display: flex;
    }
    @media (min-width: 1400px) {
        display: none;
    }
`;

const JustDiv = styled.div
`
    display: flex;
    flex-direction: column;
    align-items: flex-end;
    margin: auto;
    width: 30px;
    height: 100%;
`;

const Line = styled.div
`
    margin: 2.5px 0px;
    background: black;
    height: 2px;
    width: 30px;
`;

const Burger = () => {
    return(
        <BurgerDiv>
            <JustDiv>
                <Line/>
                <Line/>
                <Line/>
            </JustDiv>
        </BurgerDiv>
    )
}
export default Burger;
